  false,\n\t\"url\": null,\n\t\"notes\": \"Physical, nutrients, and other data from
  were collected from bottle casts from the Equatorial Pacific. Data were collected
  by the Lamont-Doherty Earth Observatory of Columbia University from 07 February
  1979 to 14 June 1980. Physical parameters include profiles of temperature, salinity,
  and sigma-t. Nutrient parameters include concentrations profiles of oxygen, phosphate,
  nitrate, nitrite, silicate, partial CO2, and total CO2. Other parameters include
  alkalinity, Delta C-14, Delta C-13, and concentration of tritium.\",\n\t\"owner_org\":
